<!-- &quot;A primary source for a topic refers to something\nproduced by some agent with direct experience and\nknowledge about the topic, at the time of the\ntopic&#39;s study, without benefit from\nhindsight. Because of the directness of primary\nsources, they &#39;speak for themselves&#39; in ways that\ncannot be captured through the filter of secondary\nsources. As such, it is important for secondary\nsources to reference those primary sources from\nwhich they were derived, so that their reliability\ncan be investigated. A primary source relation is\na particular case of derivation of secondary\nmaterials from their primary sources. It is\nrecognized that the determination of primary\nsources can be up to interpretation, and should be\ndone according to conventions accepted within the\napplication&#39;s domain.&quot; -->

</g>

<g id="node1170" class="node"><title>"Attribution is the ascribing of an entity to an\nagent. When an entity e is attributed to agent\nag, entity e was generated by some unspecified\nactivity that in turn was associated to agent ag.\nThus, this relation is useful when the activity is\nnot known, or irrelevant."</title>
<text text-anchor="middle" x="7611" y="-8871" style="font-family:Times New Roman;font-size:10.00px;">"Attribution is the ascribing of an entity to an</text>
<text text-anchor="middle" x="7611" y="-8858" style="font-family:Times New Roman;font-size:10.00px;">agent. When an entity e is attributed to agent</text>
<text text-anchor="middle" x="7611" y="-8845" style="font-family:Times New Roman;font-size:10.00px;">ag, entity e was generated by some unspecified</text>
<text text-anchor="middle" x="7611" y="-8832" style="font-family:Times New Roman;font-size:10.00px;">activity that in turn was associated to agent ag.</text>
<text text-anchor="middle" x="7611" y="-8819" style="font-family:Times New Roman;font-size:10.00px;">Thus, this relation is useful when the activity is</text>
<text text-anchor="middle" x="7611" y="-8806" style="font-family:Times New Roman;font-size:10.00px;">not known, or irrelevant."</text>
</g>

<!-- &quot;This annotation property links a subproperty of\nprov:wasInfluencedBy with the subclass of\nprov:Influence and the qualifying property that\nare used to qualify it. Example annotation: \nprov:wasGeneratedBy prov:qualifiedForm\nprov:qualifiedGeneration, prov:Generation . Then\nthis unqualified assertion: :entity1\nprov:wasGeneratedBy :activity1 . can be qualified\nby adding: :entity1 prov:qualifiedGeneration\n:entity1Gen . :entity1Gen a\nprov:Generation, prov:Influence; \nprov:activity :activity1; :customValue 1337\n. Note how the value of the unqualified influence\n(prov:wasGeneratedBy :activity1) is mirrored as\nthe value of the prov:activity (or prov:entity, or\nprov:agent) property on the influence class.&quot; -->
